import React from 'react';
import './MiniButton.sass';
import {NavLink} from 'react-dom-router';


function MiniButton(props) {
  switch(props.type) {
    case 'submit': return (
      <button className="btn-grey btnclr">{props.children}</button>
    );

    case 'link': return (
      <NavLink to={props.to}><div className="btn-grey btnclr">{props.children}</div></NavLink>      
    );

    default: return (
      <div className="btn-grey btnclr">{props.children}</div>
    );
  }
}

export default MiniButton;
